  \"2016-10-08T15:56:10.492677\",\n\t\"name\": \"research-proposal-the-seasonal-spatial-ecology-and-movements-of-the-bullsnake-pituophis-ca\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This research proposal details a two year
  study of the bullsnakes (Pituophis catenifer) at Crescent Lake National Wildlife
  Refuge. The primary goal of this investigation is a thorough description of the
  spatial ecology and movements of the bullsnake with respect to population densities
  and habitat utilization. The bullsnake population at Crescent Lake NWR has been
  previously studied by Ralph Imler of the U.S. Fish and Wildlife Service. While his
  research does provide some good background data on the natural history of the bullsnake
  in this area, the primary thrust of his work was directed towards the food habits
  of the bullsnake, especially predation upon duck nests. Information on the spatial
  biology, movements and habitat utilization of the bullsnake is necessary for its
  integration into a responsible, overall management plan.\",\n\t\"license_title\":
